import { Typography } from '@material-ui/core'
import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { myDonationOrRequestRequests } from '../../actions/userActions'
import CustomContainer from '../../components/CustomContainer'

function MyDonationsScreen() {

    const dispatch = useDispatch()
    const userDonationList = useSelector(state=>state.userDonations)
    React.useEffect(()=>{
        dispatch(myDonationOrRequestRequests('Request'))
    },[])
    console.log(userDonationList.donations)
    return (
        <div>
            {userDonationList?.donations?.map(item=>{
                return(
                    <CustomContainer>
                            <Typography variant='p' >{item.restaurant}</Typography>
                            <Typography variant='p' >{item.serving}</Typography>
                            <Typography variant='p' >{item.quantity}</Typography>
                    </CustomContainer>
                )
            })}
        </div>
    )
}

export default MyDonationsScreen
